(4, 'John', '', 'Humphrey', '11-01-69', '1301 BLUE SPRUCE RD', 'address2', 'DERBY', 'KS', 67037, '', '316-680-2196', '', '', '', '', '', '', 0, '', '', '', 'Linda', 'Goddard', 'emeraddress', '316-680-2438', 'EmerRelationupdate', 'NV2S2', 1, 'Key time', 1999, 'Checkmate', 'V', 0, 2, 'S', 454, 'I/O Bravo', '', 'SU', 'johnhumphrey1@cox.net', 'Originally from St. Louis, MO area. Life-long boater on Lake of the Ozarks; third straight yr in Shootout. NV2S2 class champion in 2009 and 2010 (only competitor!). Representing "Team Runnin'' & Gunnin''". Happy to run the number and support the event. ', -2),
