(9, 'Christopher', 'H', 'Winter', '08/14/1961', '34886 Summerwood Dr.', 'address2', 'Yucaipa', 'CA', 92399, '', '909-583-4797', '', '', '', '', '', '', 0, '', 'none', '', 'Kathy', 'Ramos', 'emeraddress', '909-446-9472', 'EmerRelationupdate', 'NC2P1', 2, 'none', 2007, 'Eliminator Daytona', 'C', 27, 1, '567 dart', 0, '', '', 'SU', 'two4winz@lycos.com', '3rd yr hooked for life; rolling out 1700 miles to defend my championship in class. Will all the GT Performance. Shootout guys - this year I have my son Austin Winter on the throttles, his 1st yr.', -1),
(10, 'Kelly', '', 'Kraiss', '1-22-64', '3820 Apache Maid Drive', 'address2', 'Lake Havasu Cit', 'AZ', 86406, '', '928-230-3495', '', '', '', '', '', '', 0, '', '', '', 'Anna', 'Kraiss', 'emeraddress', '928-533-9179', 'EmerRelationupdate', 'NC3P2', 1, 'Full Blown', 2002, 'Skater', 'C', 32, 2, '', 572, 'Mercury #6', 'Blower shop 14-71 Super chargers/Twin 1050 Dominators', 'SU', 'kelly.k@primeair.com', '2006 was my first year at the Shootout to watch Ron Gibbs race his single engine twin Arneson powered 26'' Firehawk. We came in 2007 and I tied 1st place in my class with my 30'' Spectre, Ron took 2nd in his class (by 1 mph) with the Firehawk. We have been running the Desert Storm Poker Run and Shootout for a number of years and thought it was time to come back to the Ozarks. This year we are bringing my 32'' Skater and are looking forward to the event as well as Skaterfest.', -4),
