(17, 'Michael', '', 'Janssen', '12/16/58', '9005 Grant Street', 'address2', 'Denver', 'CO', 80229, '', '303-886-6800', '', '', '', '', '', '', 0, '', 'Center for Spinal Disorders', '', 'Sharon', 'Janssen', 'emeraddress', '303-886-6804', 'EmerRelationupdate', 'PV5P2', 1, 'TAZ', 2006, 'Fountain', 'V', 47, 2, 'P', 557, 'SSM VI', '', 'SU', 'drmjanssen@aol.com', 'Few lpeople on earth can actually bring it all together: adventure, complex challenges, family and friends! Cutting Edge Marine is the combination for Michael (Doc) Janssen, the founder of Cutting Edge Marine. Doc Janssen is a successful and internationally renowned reconstructive suspine surgeon who brings the same passion for research and successful patient outcomes to offshore boat racing. The TAZ-2010, 2009, 2008, 2007, 2006 Lk of the Ozarks Shootout Class winner. ', -3),
