(20, 'Chris', '', 'Johnson', '4-11-69', '463 Barnaby Dr.', 'address2', 'Oswego', 'IL', 60543, '', '630-333-5193', '', '', '', '', '', '', 0, '', '', '', 'Brandi', 'Johnson', 'emeraddress', '630-853-9478', 'EmerRelationupdate', 'NC1P1', 1, 'Awesome Awesome', 2003, 'Awesom', 'C', 22, 1, '', 558, 'B-Max', '', 'SU', 'prismmechanical.comcast.net', 'I''ve been boating my whole life. Started out with jet boats and moved up to a 25'' Sunsation and now I have a 36'' Mainship cruiser and a 26'' Awesome. I love speed on water! I boat on the IL River with my wife Brandi and daughter,Elise. I''ve been coming to the Lk of the Ozarks for 12 years and have enjoyed the Shootout, but never run in it. This is my 1st yr running. I gifure I run my own Shootout every weekend so what the heck!!  I love the excitement of Fast Boating!', -2),
(21, 'Michael', '', 'Janssen', '12/16/58', '9005 Grant St, Suite 100', 'address2', 'Denver', 'CO', 80229, '', '303-886-6800', '', '', '', '', '', '', 0, '', 'Center for Spinal Disorders', '', 'Terry', 'Janssen', 'emeraddress', '515-210-4497', 'EmerRelationupdate', 'PV2F1', 1, 'Watch Your Back', 2011, 'Fountain Poker Run', 'V', 30, 1, '', 502, 'Bravo', '', 'SU', 'drmjanssen@aol.com', 'Few people on  earth canactually bring it all together: adventure, complex challenges, family and friends! Cutting Edge Marine is the combination for Michael (Doc) Janssen, the founder of cutting Edge Marine. Doc Janssen is a successful and internationally renowned reconstructive spine surgeon who brings the same passion for research and successful patient outcomes to offshore boat racing. The TAZ 2010, 2009, 2008, 2007, 2006 Lk Shootout Class Winner. ', -2),
