(23, 'Neil', '', 'Wobbe', '2-25-70', '1600 S Ocean Blvd #1901', 'address2', 'Ft. Lauderdale', 'FL', 33301, '', '443-603-7884', '', '', '', '', '', '', 0, '', 'Fastboats.com/Loriblu', '', 'Brenda', 'Hughes', 'emeraddress', '314-496-4598', 'EmerRelationupdate', 'PC4F2', 1, 'Lori Blue', 2011, 'MT1', 'C', 36, 2, '', 502, 'SSM', '', 'SU', 'mstringfellow@ftbayarea.com', 'Owner/throttleman Randy Sweers; 2nd driver Mike Stringfellow. President Fastboats Marine Group Ft.Lauderdale, FL. 2011 40'' MT1 "Supercat" race boat. Six time Shootout participant. Current national points leader in Superboat racing. ', -5),
(24, 'Fredrick', 'W', 'Ley', '9-12-52', '10707 Sagamore Lane', 'address2', 'Bentonville', 'AR', 72712, '', '214-802-2499', '', '', '', '', '', '', 0, '', '', '', 'Yvonne', 'Ley', 'emeraddress', '214-802-2599', 'EmerRelationupdate', 'NC4P2', 2, 'Nor''Easter', 2000, 'Skater', 'C', 36, 2, '', 632, '# 6 Merc', '', 'SU', 'fred.ley@wal-mart.com', '2nd year in Shootout. Boat ran 177 last yr; had year to work out some bugs. Been boating since I was 13-45 yrs now. Leon Dereby (throttleman) has been racing since the early days of Offshore and he built the engines we''re running. You don''t ask, but the bpat is named Nor''easter- the baddest of all storms.  ', -1),
